import React, { useState } from "react"

import {
  BarChart,
  Bar,
  Cell,
  CartesianGrid,
  XAxis,
  YAxis,
  Tooltip,
  Legend
} from "recharts";

import subways_with_tracts from './data/subways_with_tracts.json'

function RenderBarChart() {
    const var_key = [
        {
            key: 'DP03_0062E', variable_name:'Median Household Income'
        },
        {
            key: 'DP03_0119E', variable_name:'Percentage of Families and People Whose Income in the Past 12 Months is Below the Poverty Level'
        },
        {
            key: 'DP03_0119PE', variable_name: 'Percentage of Families and People Whose Income in the Past 12 Months is Below the Poverty Level (%)'
        },
        {
            key: 'DP02_0015E', variable_name:'Average Household Size'
        },
        {
            key: 'DP02_0014PE', variable_name:'Percentage of Households with One or More People 65 Years and Over'
        },

    ]

    return (
        <div>
            <BarChart
                width={500}
                height={300}
                data={subways_with_tracts}
                margin={{
                top: 5, right: 30, left: 20, bottom: 5,
                }}
            >
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="Stop_Name" />
                <YAxis />
                <Tooltip />
                <Legend />
                <Bar dataKey="DP05_0071PE" fill="#8884d8" />
            </BarChart>
        </div>

    );
}

export default RenderBarChart;
